import styled from 'styled-components';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom';
import {Button} from 'reactstrap';


export default function Landing (props) {


    return (
        // Render the Pizza component 
        <div> 
            <StyledBanner>
                <div className='image-wrapper'> 
                    <img className='banner' src= 'https://relaxedpowerful.s3.us-east-2.amazonaws.com/landing-banner.jpg' alt='banner'/> 
                </div>                

                <Link to='/pizza'>
                    <div className='buttons-container'> 
                    <Button color='primary' className='quick-order' id='pizza'>
                        Pizza 
                    </Button>
                    </div>
                </Link>
                    {/* <Route path='/pizza' component={} /> */}
            </StyledBanner>
            {/* <Restaurants /> */}

        </div>

    )
};

const StyledBanner =styled.div `
border: green 2px dashed;
margin-top: 20px;    
display: flex;
flex-flow: column wrap;
justify-content: center;
align-items: center;

    .image-wrapper{
        border: 1px red solid;
        display: flex;
        flex-flow: column wrap;
        justify-content: center;
        align-items: center;
        max-width: 90%;
        max-height: 20%;
    }
    .banner {
        width: 100%;
        height: auto;
    }
    .buttons-container {
        display: flex;
        min-width: 40%;
        justify-content: center;
    }
    .quick-order{
        min-width: 100px;
    }
    p{
        margin-top: 10px;
    }
`
